/**
 * Funcion encargada de cambiar de tiempo de video o tiempo diapositivita
 */
function changeTimeNow(bandClic){
    switch(bandClic){
        case 0:
            changePresentation()
            break;
        case 1:
            changeTimeSlide()
            break;
    }          
}
